import React from 'react'
import fort from '../assets/images/fort.png';
import world1 from '../assets/images/world1.png';
import Taj from '../assets/images/Taj.png';
import qutub from '../assets/images/qutub.png';
import gate from '../assets/images/gate.png';

const Explore = () => {
  return (
    <div>
       <div class="container mt-4 gap-3">
      <div class="row gap-2">
    <div class="col"><img src={gate} alt="w1" className='w-full h-72'/></div>
    <div class="col"><img src={fort} alt="w1" className='w-full h-72'/></div>
    <div class="w-100"></div>
    <div class="col"><img src={Taj} alt="w1" className='w-full h-72'/></div>
    <div class="col"><img src={qutub} alt="w1" className='w-full h-72'/></div>
    </div>
</div>
      
    </div>
  )
}

export default Ex
